description:
A my NOS, a sua assistente pessoal, já chegou! Descubra a nova aplicação NOS, cuidadosamente desenhada a pensar em si. Com uma experiência de navegação renovada, esta app é acessível a todos os utilizadores, simplificando a gestão da sua relação com a NOS.

Com a my NOS, a personalização atinge novos patamares. Tudo o que é relevante para si - desde consultar saldos, pagar faturas até explorar vantagens exclusivas - está agora ainda mais acessível na sua página inicial. Utilize a função de pesquisa para encontrar facilmente o que procura, incluindo funcionalidades disponíveis noutros canais digitais.

Faça o download da my NOS agora e assuma o controlo da sua conta:

•Consulte, compare faturas e efetue pagamentos;
•Monitorize o consumo de dados, minutos e SMS, verifique o saldo e recarregue o seu telemóvel;
•Analise o detalhe das comunicações e gerencie pacotes extras de internet;
•Acesse informações da conta de cliente, consulte detalhes de todos os serviços contratados e atualize os seus contactos;
•Explore vantagens exclusivas e aproveite o Cartão NOS para ofertas exclusivas nos Cinemas NOS.

Após a instalação, faça o login com o seu NOS ID ou registe-se diretamente na aplicação. Se já utiliza outras apps ou sites da NOS, pode usar os mesmos dados de acesso para iniciar sessão.
O acesso à my NOS não consome dados móveis nem implica custos na rede NOS.

Faça o download agora e desfrute da my NOS, sempre pronta a facilitar a sua vida!
